<template >
    <view class="content">
		<!-- 显示默认头像 -->
		<view class="cu-avatar xl round margin-left" 
		style="margin: 0 auto;background-image: url('https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1564137772253&di=89bb4222e006388cfe34a85fbb35aa49&imgtype=0&src=http%3A%2F%2F001.img.pu.sohu.com.cn%2Fgroup2%2FM01%2FF1%2FD8%2FMTAuMTAuODguODE%3D%2FMTAwMTE0XzE1MjI2NTYxMjMxNDA%3D%2Fcut%40m%3Dresize%2Cw%3D400%2Ch%3D400_cut%40m%3Dcrop%2Cx%3D0%2Cy%3D0%2Cw%3D400%2Ch%3D400.jpg');">
		</view>
		
        <view class="input-group">
            <view class="input-row border">
                <text class="title">账号：</text>
                <m-input class="m-input" type="text" clearable focus v-model="account" placeholder="请输入账号"></m-input>
            </view>
            <view class="input-row">
                <text class="title">密码：</text>
                <m-input type="password" displayable v-model="password" placeholder="请输入密码"></m-input>
            </view>
        </view>
        <view class="btn-row">
            <button type="primary" class="primary" @tap="bindLogin">登录</button>
        </view>
		
		<!-- 登录按钮后显示加载中....弹窗 -->
		<view class="cu-load load-modal" v-if="loadModal">
			<image src="/static/logo.png" mode="aspectFit"></image>
			<view class="gray-text">{{TipsText}}</view>
		</view>
		<!-- 显示公司LOGO -->
		<view style="text-align: center;">
		<image  :src="imageBase64"   mode="aspectFit" style=": table-cell;">
		</image>
		</view>
		
		
		<!-- 显示下载更新进度条 -->
		<view v-if="update">
		<view style="margin: 0 auto;">下载进度:{{RemainTime}}%</view>
		<view class="cu-progress round sm striped" :class="'active'">
			<view class="bg-green" :style="[{ width:RemainTime+'%'}]"></view>
		</view>
		</view>
    </view>
</template>

<script>
    import {
        mapState,
        mapMutations
    } from 'vuex'
	// 导入显示隐藏密码js
    import mInput from '../../components/m-input.vue'
    export default {
        components: {
            mInput
        },
		onLoad() {
			let that=this;
			// 检测版本更新
			// #ifdef APP-PLUS  
			plus.runtime.getProperty(plus.runtime.appid, function(widgetInfo) {
				uni.request({
					url: 'http://www.aot9a.cn/index/user/apiversion',
					data: {
						version: widgetInfo.version,
						appid: plus.runtime.appid
					},
					method: 'GET',
					success: (result) => {
						console.log(result.data)
						var data = result.data;
						if (data.status === 1) {
							uni.showModal({
								title: '有新版本更新！！！',
								content: data.note,
								showCancel: false,
								success(res) {
									if (res.confirm) {
										that.update=true;
										var downloadTask = uni.downloadFile({
											url: data.url,
											success: (downloadResult) => {
												if (downloadResult.statusCode === 200) {
													plus.runtime.install(downloadResult.tempFilePath, {
														force: false
									 				}, function() {
														console.log('安装成功,重启应用!!!');
														plus.runtime.restart();
													}, function(e) {
														console.error('安装失败!!!');
													});
												}
											}
										});
										downloadTask.onProgressUpdate((res) => {
											that.RemainTime=res.progress;
										});
									}
								}
							})
			
						}
			
					}
				});
			});
			// #endif  
			this.imageBase64='data:image/png;base64,';
			},
        data() {
            return {
				TipsText: '登录中...',
                account: '',
                password: '',
                positionTop: 0,
				loadModal: false,
				imageBase64: '',
				RemainTime: 0,
				update: false
            }
        },
        methods: {
			...mapMutations(['setKey','setPsw','setG_G_GroupList','setG_UserList','setToken','setSC']),
            initPosition() {
                /**
                 * 使用 absolute 定位，并且设置 bottom 值进行定位。软键盘弹出时，底部会因为窗口变化而被顶上来。
                 * 反向使用 top 进行定位，可以避免此问题。
                 */
                this.positionTop = uni.getSystemInfoSync().windowHeight - 100;
            },
            bindLogin() {
                /**
                 * 客户端对账号信息进行一些必要的校验。
                 * 实际开发中，根据业务需要进行处理，这里仅做示例。
                 */
                if (this.account.length < 5) {
                    uni.showToast({
                        icon: 'none',
                        title: '账号最短为 5 个字符'
                    });
                    return;
                }
                if (this.password.length < 6) {
                    uni.showToast({
                        icon: 'none',
                        title: '密码最短为 6 个字符'
                    });
                    return;
                }
                const data = {
                    account: this.account,
                    password: this.password
                };
				this.loadModal = true;
				this.TipsText='登录中...'
				setTimeout(() => {
					this.loadModal = false;
				}, 2000);
				
				let rot = this;
				// 请求服务器数据
				uni.request({
					url: 'http://www.aot9a.cn/index/user/apickecklogin', //请求地址
					data: {
						account: data.account,
						password: data.password 
					},
					header: {
						'content-type': 'application/x-www-form-urlencoded', 
					},
					dataType:'json',
					method:'POST',
					success(res) {
							let _data=JSON.stringify(res.data);
							if(res.data.status==1)
							{
							rot.TipsText='登录成功!'
							// 将数据缓存到本机
							uni.setStorage({
								key: res.data.info.id+'',
								data: _data,
								success: function () {
									console.log(res.data)
									// 将用户id存到全局变量
									rot.setKey(res.data.info.id+'');
									// 将用户加密密码存到全局变量
									rot.setPsw(res.data.info.password);
									// 将用户分组列表存到全局变量
									rot.setG_G_GroupList(res.data.grouplist);
									// 将用户好友列表存到全局变量
									rot.setG_UserList(res.data.memberlist);
									// 将用户Token信息存到全局变量
									rot.setToken(res.data.info.channel_access_token);
									// 将用户secret存到全局变量
									rot.setSC(res.data.info.channel_secret)
								}
							});
							//登录成功跳转到聊天主页面
							uni.switchTab({
								url: '/pages/main/main'
							});
							}else{
								rot.TipsText='登录失败';
							}
					}
				});
            }
        }
    }
</script>

<style>
    .action-row {
        display: flex;
        flex-direction: row;
        justify-content: center;
    }

    .action-row navigator {
        color: #007aff;
        padding: 0 20upx;
    }

</style>
